import Table from './componet/Table';
import Card from './componet/Card';
import { useState } from 'react';


function App() {
  const [state, setState] = useState(true)

  return (
    <div>
      {
        state ? <Card /> : <Table />
      }

      <button onClick={(() => { setState(false) })}>Show Card</button>
      <button onClick={(() => { setState(true) })}>Show Table</button>

    </div>
  )
}

export default App;
